import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './login.scss';

function LoginForm() {

  const navigate = useNavigate();
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleLogin = (event) => {
    event.preventDefault();

    // Here you would typically call a function to authenticate the user,
    // for example, by sending a request to a server. For simplicity, we'll just log the username and password.
    console.log(`Logging in with username: ${username} and password: ${password}`);

    // Redirect to the home page after logging in
    navigate('/chat');
  };

  const handleInputChange = (event) => {
    if (event.target.name === 'username') {
      setUsername(event.target.value);
    } else if (event.target.name === 'password') {
      setPassword(event.target.value);
    }
  };
  return (
    <div className="login-form">
        <div className="content">
            <form onSubmit={handleLogin}>
                <div className="email">
                    <label for="email">Username</label>
                    <div className="sec-2">
                        <input type="email" name="username" className="email" onChange={handleInputChange} />
                    </div>
                </div>
                <div className="password">
                    <label for="password">Password</label>
                    <div className="sec-2">
                        <input type="password" name="password" className="password" onChange={handleInputChange} />
                    </div>
                </div>
                <button type="submit" className="login">Login</button>
            </form>
        </div>
    </div>
  );
}
export default LoginForm;
